      SELECT - + 35 + - - ( - col0 ) - + - col0 * + col2 / - col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - CAST ( NULL AS REAL ) NOT BETWEEN + col0 AND NULL;
  - name: tab2

outputs:
  - name: q5149.out
    data: |
